import { add, sub, div, mul } from "./App.jsx";
ReactDOM.render(
  <>
    <ul>
      <li> Sum of two numbers is {add(3, 4)}</li>
      <li> Sub of two numbers is {sub(3, 4)}</li>
      <li> Div of two numbers is {div(3, 4)}</li>
      <li> Multiplication sum of two numbers is {mul(3, 4)}</li>
    </ul>
  </>,
  document.getElementById("root")
);
